import React from "react";
import "./Login.css";
import ShopTwoToneIcon from "@material-ui/icons/ShopTwoTone";
import { Link, useHistory } from "react-router-dom";
function Login() {
  return (
    <div className="login">
      <Link to="/">
        <ShopTwoToneIcon className="login__logo" />
      </Link>
      <div className="login__container">
        <h1>Sign in</h1>
        <form>
          <h5>E-mail</h5>
          <input type="text" />
          <h5>Password</h5>
          <input type="text" />
          <button className="login__signInButton">Sign In</button>
        </form>
        <p>
          By signing-in you agree to Baskify's Conditions of Use & Sale. Please
          see our Privacy Notice, our Cookies Notice and our Interest-Based Ads
          Notice.
        </p>
        <button className="login__registerInButton">
          Create your Baskify Account
        </button>
      </div>
    </div>
  );
}

export default Login;
